  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Mud Lake NWR
  outlines Refuge accomplishments from January through April of 1960. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, safety, plantings, and planned burning. Resource management is outlined;
  topics include fur harvesting. A progress report on field investigations and applied
  research is also provided. The public relations section of the report lists Refuge
  visitors. Items of interest, N-R forms, news releases, and photographs are attached.\",\n\t\"license_title\":
